import React from 'react';
import { CloseIcon, SidebarContainer, Icon } from './SidebarElements';

const Sidebar = () => {
  return (
    <SidebarContainer>
        <Icon>
            <CloseIcon/>
        </Icon>
        <SidebarWrapper>
            <SidebarMenu>
                <SidebarLink to="Home">
                    Home
                </SidebarLink>
                <SidebarLink to="Alarms">
                    Alarms
                </SidebarLink>
                <SidebarLink to="Sign Up">
                    Sign Up
                </SidebarLink>
            </SidebarMenu>
        </SidebarWrapper>
    </SidebarContainer>
  );
};

export default Sidebar;
